import Link from 'next/link';
import styles from './Example.module.css'


const Header = () =>(
    <div className={styles.test} >
        <Link href='/'>
            <a className={styles.header-continer-2}>Home</a>
        </Link>
        <Link href='/contact'>
            <a className={styles.test}>Contact</a>
        </Link>
    </div>
)

export default Header;
